¡Ron Deadhead y Master Class! 🖤🥃🔥 con Adolfo Romero.

El viernes pasado tuvimos el honor de recibir a @fritos, quien nos presentó @deadheadrum en una Master Class, seguido de su propuesta de coctelería en nuestra barra por la noche. 🍹✨

Ron Deadhead es un ron artesanal de alta calidad elaborado con pasión y cuidado en Chiapas, famoso en el mundo de la coctelería Tiki por su concepto y excelente calidad. Adolfo Romero, mixólogo y restaurantero empírico, es un apasionado del servicio y de desarrollar experiencias sensoriales enfocadas a la completa satisfacción del cliente. 🖤🔥

También pudimos disfrutar en sus cocteles del Ron y el Pox de @ronbonampak_oficial . 🥃✨

La visita de Adolfo y su presentación fueron extraordinarias, llenas de energía y dedicación, ofreciendo a todos los asistentes un día inolvidable para los amantes de la cultura líquida. ¡Esperamos tenerlos de vuelta pronto! 🥃✨

