@kissoflife_s2 is Billboard’s K-Pop Rookie of the Month 🌟

Debuting with their first mini-album ‘KISS OF LIFE’ in 2023, the group has steadily gained both recognition and sales in the Korean market — plus, their first single album “Midas Touch” earned them their debut on the Billboard Global 200 chart. In a K-pop industry increasingly dominated by major corporations, KISS OF LIFE has been dubbed the “miracle of mid-sized companies.”

Read Billboard’s interview with members Julie, Natty, Belle and Haneul + see exclusive pics at the link in bio.

@sabrinacarpenter is No. 2 on Billboard’s list of the 10 Greatest Pop Stars of 2024 🥈

Sabrina Carpenter solidified her pop superstardom in 2024 with chart-topping hits like “Please Please Please” and standout festival performances. With an acclaimed ‘Short n’ Sweet’ album and a third smash single, “Taste,” Carpenter’s year was marked by undeniable success and dominance.

